        [TestMethod]
        public void UpdateBitGoAccessCodeEncrypt()
        {
            using (MonniData context = new MonniData())
            {
                string[] appSettings = new string[] { "QuickPayDetails_Prod" };
                for (var i = 0; i < appSettings.Length; i++)
                {
                    var settingsValue = appSettings[i];
                    var appSetting = context.AppSettings.Single(x => x.ConfigKey == settingsValue);
                    if (!appSetting.IsEncrypted)
                    {
                        appSetting.IsEncrypted = true;
                        appSetting.ConfigValue = SecurityUtil.Encrypt(appSetting.ConfigValue);
                        context.SaveChanges();
                    }
                }

            }
        }

